import { createContext } from "react";
import React, { useState } from "react";

import MyBtn from "../Components/Temp/MyBtn";
import MyInput from "../Components/Temp/MyInput";
import MyResponse from "../Components/Temp/MyResponse";

export const CurrentContext = createContext(null);

function Temp() {
  const [forename, setForename] = useState("");
  const [surname, setSurname] = useState("");
  const [postcode, setPostcode] = useState("");

  const handlePatientDataChange = (forename, surname, postcode) => {
    setForename(forename);
    setSurname(surname);
    setPostcode(postcode);
  };

  return (
    <>
      <h1>
        <MyInput />
        <br />
        <MyBtn callBack={handlePatientDataChange} />
        <br />
        <MyResponse />
      </h1>
    </>
  );
}

export default Temp;
